import React from 'react';
import { Text, View } from 'react-native';
import AppText from '../../components/text/AppText';
import colors from '../../styles/colors';
import { styles } from '../../styles/styles';

const ContactScreen = () => {
    const { secondary } = colors
    const { flex_1, centered } = styles;

    return (
        <View style={[flex_1, centered]}>
            <AppText as="h1" color={secondary}>Maximarket</AppText>
            <AppText>Maximarket, De Castro Avenue, Brgy. Santa Lucia, Pasig City</AppText>
            <AppText>0927-6960322</AppText>
        </View>
    );
}

export default ContactScreen;
